import React from 'react';
import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import '../src/index.css';
import FFheader from './components/FFheader';
import FFabout from './components/About/FFabout';
import FFtrainer from './components/Trainers/FFtrainer';
import './components/FFheader.css';
import './components/About/FFabout.css';
import './components/FFservice.css';
import './components/Trainers/FFtrainer.css';
import './components/FFfooter.css';
import './components/Navbar.css';
import Navbar from './components/Navbar';
import FFservice from './components/FFservice';
import FFfooter from './components/FFfooter';
import Productsection from './components/Productsection';
const App = () => {
  return (
    <>
    <BrowserRouter>
    <Navbar />
      <Routes>
        <Route path="/about" element={<FFabout />} />
        <Route path="/service" element={<FFservice />} />       
        <Route path="/products" element={<Productsection />} />       
        <Route path="/trainer" element={<FFtrainer />} />
        <Route path="/footer" element={<FFfooter />} />
      </Routes>
    </BrowserRouter>
    <FFheader/>
    <FFabout/>  
    <FFservice/>
    <Productsection />
    <FFtrainer/>
    <FFfooter/>
    </>

  );
}

export default App;
